import React, { useContext } from 'react';
import axios from 'axios';
import TodoList from '../components/TodoList';
import TodoForm from '../components/TodoForm';
// import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import { handleAuthSSR } from '../components/handleAuthSSR';

import Grid from '@material-ui/core/Grid';
import { UserContext, UserProvider } from '../components/contexts/user.context';
import { TodosProvider } from '../components/contexts/todos.context';

var token;

function TodoAppPage() {
  token = useContext(UserContext);
  console.log('todoapp page token: ', token);

  return (
    <Paper
      style={{
        paddding: 0,
        margin: 0,
        height: '100vh',
        backgroundColor: '#fafafa'
      }}
      elevation={0}
    >
      <Grid container justify="center" style={{ marginTop: '1rem' }}>
        <Grid item xs={11} md={8} lg={4}>
          <TodosProvider>
            <TodoForm />
            <TodoList />
          </TodosProvider>
        </Grid>
      </Grid>
    </Paper>
  );
}

TodoAppPage.getInitialProps = async () => {
  await handleAuthSSR();
  return {};
};

export default TodoAppPage;
